import React from 'react'
import './../App.css'
import { AuthConsumer } from '../helper/AuthContext'

function Home() {
    return (
        <section id="home">
            <div className="logout-btn-wrapper">
                <AuthConsumer>
                    {({ user, logout }) => (
                        <button className="btn logout-btn" onClick={logout}>
                            Logout
                        </button>
                    )}
                </AuthConsumer>
            </div>
        </section>
    )
}

export default Home
